import React from 'react';
import Card from './Card';
const CardList = ({cats}) =>
{
    const catComponent = cat.map(user =>{
    return <Card id={cats[user].id} name={cats[user].name} email={cats[user].email}/>
    }
        )
    return(
    <div>
    </div>
    );
}

export default CardList;
